import './App.css';
import Backendless from 'backendless';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import FileManage from './UserFileManager';

const APP_ID = process.env.REACT_APP_BACKENDLESS_APP_ID;
const API_KEY = process.env.REACT_APP_BACKENDLESS_SECRET_KEY;

Backendless.serverURL = 'https://eu-api.backendless.com';
Backendless.initApp(APP_ID, API_KEY);

function App() {
    return (
        <Router>
            <Switch>
                <Route exact path="/" component={FileManage} />
            //    <Route path="/delete-folder" component={DeleteFolder} />
            </Switch>
        </Router>
    );
}

export default App;
